import styled from 'styled-components';
import React from "react";

function Navbar() {
  const [data, setData] = React.useState(null);

  return (
    <div className="Navbar">
      <Nav className="z-50 transform -translate-x-1/2 left-1/2 navbar px-10 py-4 bg-white hover:border hover:border-black hover:shadow-md">
            <div>
                {/* <div className="grid grid-cols-8 gap-x-4"> */}
                    <div className="col-start-1 col-span-1 inline">
                        <Title>PANGCU</Title>
                    </div>
                    <div className="inline nav-collapse justify-start flex gap-3 content-center text-center w-full">
                        <div className="a flex"><a className="self-center" href="#1">Home</a></div>
                        <div className="a flex"><a className="self-center" href="#2">Chat</a></div>
                        <div className="a flex"><a className="self-center" href="#3">Page 3</a></div>
                        <div className="a flex"><a className="self-center" href="#4">Page 4</a></div>
                        <div className="float-right flex">
                            <button className="focus:ring rounded-full py-1 px-14 self-center text-white bg-gradient-to-r from-113D8B to-3075EC">Sign in</button>
                        </div>
                    </div>
                    <div className="relative text-left col-start-8 flex">
                        <div className="flex self-center justify-self-aut">
                            <button onClick={() => {
                              console.log('nothing :D')
                            }} type="button"
                                className="
                            hidden self-center justify-self-auto min-w-8 p-2 h-full justify-center rounded-md 
                            border border-gray-300 shadow-sm bg-white text-sm font-medium text-gray-700 
                            hover:bg-gray-50 
                            focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-100 focus:ring-indigo-500"
                                id="options-menu" aria-expanded="true" aria-haspopup="true">
                                <svg className="self-center justify-self-auto h-6 w-6" viewBox="0 0 20 20" xmlns="http://www.w3.org/2000/svg"><title>Menu</title><path d="M0 3h20v2H0V3zm0 6h20v2H0V9zm0 6h20v2H0v-2z"></path></svg>
                            </button>
                        </div>
                    </div>
                    {/* rounded-md ring-1 shadow-lg ring-black ring-opacity-5 */}
                    <div id="dropdown-menu" className="origin-top-right right-0 mt-2 w-56 bg-white focus:outline-none" role="menu" aria-orientation="vertical" aria-labelledby="options-menu">
                        <div className="py-1" role="none">
                            <a href="#1" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 hover:text-gray-900" role="menuitem">Account settings</a>
                            <a href="#2" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 hover:text-gray-900" role="menuitem">Support</a>
                            <a href="#3" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 hover:text-gray-900" role="menuitem">License</a>
                            <a href="#4" className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 hover:text-gray-900" role="menuitem">Something else</a>
                        </div>
                    </div>
                {/* </div> */}
            </div>
        </Nav>
    </div>
  );
}

export default Navbar;

const Title = styled.h1`
  font-family: Poppins;
  font-size: 30px;
  font-style: bold;
  font-weight: 900;
  letter-spacing: 0em;
  text-align: left;
`;

const Nav = styled.nav`
  transition:0.5s;
  display: block;
  position:fixed;
  margin-left: auto;
  margin-right: auto;
  margin:auto;
  width:100vw;
`;
